import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './HomeBody.css'
import ReadMore from './ReadMore';

function AddPostBody() {
    
    return (
        <div>
             <form>
                 <div class="mb-3">
                 <label for="Title" class="form-label">Blog title</label>
                 <input type="text" class="form-control" id="title" aria-describedby="title"/>
                 </div>
                 <div class="form-floating">
                 <textarea class="form-control" placeholder="Enter blog content" id="body" style="height: 100px"></textarea>
                 <label for="floatingTextarea2">Enter blog content</label>
                 </div>
                 <select class="form-select" aria-label="Default select example">
                    <option selected>Categorirs</option>
                    <option value="1">One</option>
                    <option value="2">Two</option>
                    <option value="3">Three</option>
                </select>
                 <button type="submit" class="btn btn-primary">Post</button>
             </form>
        </div>
    );
    
}

export default AddPostBody;
